	add("thursday", "{\"term\":\"thursday\", \"etymology\":{\"influencers\":[], \"languages\":[\"old english (ca. 450-1100)\", \"Danish\", \"English\", \"middle english (1100-1500)\", \"old norse\"], \"text\":\"From Middle english (1100-1500) from Old english (ca. 450-1100) {{m|ang|þursdæġ}}, {{m|ang|þurresdæġ||Thursday}}, possibly from a contraction of Old english (ca. 450-1100) \u0027þunresdæġ\u0027 (thursday) but more likely of origin, from Old norse \u0027þórsdagr\u0027 or Old Danish \u0027þursdag\u0027 all from Proto-germanic {{m|gem-pro|*Þunras dagaz||Thor\u0027s day}}. Compare West Frisian \u0027tongersdei\u0027 Low German \u0027dunnersdag\u0027 Dutch \u0027donderdag\u0027 German \u0027donnerstag\u0027 Danish \u0027torsdag\u0027 More at {{l|en|thunder}}, {{l|en|day}}.A calque of Latin \u0027dies Iovis (dies Jovis)\u0027, via an association of the god Thor with the Roman god of thunder Jove (Jupiter).\"}, \"definitions\":{\"list\":[{\"upperType\":\"NOUN\", \"text\":\"The fifth day of the week in many religious traditions, and the fourth day of the week in systems using the ISO 8601 norm; it follows Wednesday and precedes Friday.\u0026lt;!-- probably just an attributive use of the noun\", \"priority\":1},{\"upperType\":\"NOUN\", \"text\":\"An appointment, person, or feeling associated with this day of the week.--\u0026gt\", \"priority\":2}]}, \"synonyms\":{}}");

